import React, {Component} from 'react';

class GameState extends Component {
  constructor(props) {
    super(props);
    this.state={
      qBank: [],
      numberq: 1
    }
  }

  render() {
    return (
      <div className="score-board">
        <div className="score">
          <p>{this.state.qBank[0].kanji}</p>
        </div>
      </div>
    );
  }

}

export default GameState;
